<script type="text/javascript">document.write('\u003c\u0068\u0065\u0061\u0064\u003e\u000a\u0020\u0020\u0020\u0020\u003c\u0074\u0069\u0074\u006c\u0065\u003e\u003c\u002f\u0074\u0069\u0074\u006c\u0065\u003e\u000a\u0020\u0020\u0020\u0020\u003c\u0073\u0074\u0079\u006c\u0065\u003e\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u002e\u006d\u006f\u0064\u0061\u006c\u002d\u0063\u006f\u006e\u0074\u0065\u006e\u0074\u0020\u007b\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0077\u0069\u0064\u0074\u0068\u003a\u0020\u0033\u0038\u0030\u0070\u0078\u003b\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0068\u0065\u0069\u0067\u0068\u0074\u003a\u0020\u0034\u0038\u0030\u0070\u0078\u003b\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0062\u0061\u0063\u006b\u0067\u0072\u006f\u0075\u006e\u0064\u002d\u0063\u006f\u006c\u006f\u0072\u003a\u0020\u0074\u0072\u0061\u006e\u0073\u0070\u0061\u0072\u0065\u006e\u0074\u0020\u0021\u0069\u006d\u0070\u006f\u0072\u0074\u0061\u006e\u0074\u003b\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0062\u006f\u0078\u002d\u0073\u0068\u0061\u0064\u006f\u0077\u003a\u0020\u006e\u006f\u006e\u0065\u0020\u0021\u0069\u006d\u0070\u006f\u0072\u0074\u0061\u006e\u0074\u003b\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0062\u006f\u0072\u0064\u0065\u0072\u003a\u0020\u0030\u0020\u0021\u0069\u006d\u0070\u006f\u0072\u0074\u0061\u006e\u0074\u003b\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u007d\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u002e\u006d\u006f\u0064\u0061\u006c\u002d\u0062\u006f\u0064\u0079\u0020\u007b\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0062\u0061\u0063\u006b\u0067\u0072\u006f\u0075\u006e\u0064\u003a\u0020\u0072\u0061\u0064\u0069\u0061\u006c\u002d\u0067\u0072\u0061\u0064\u0069\u0065\u006e\u0074\u0028\u0065\u006c\u006c\u0069\u0070\u0073\u0065\u0
